export default function getPossiblePaths(start, end, graph, visitRoute = '', count = 0) {
    const edges = graph[start];
    console.log('START here', start);
    console.log('edges1', edges);

    if (visitRoute && start === end) {
        // We found the path
        console.log(visitRoute + end + '=' + count)
        return visitRoute + end + '=' + count;
    }

    if (!edges) {
        // deadend
        return '';
    }
    console.log('visitRoute1', visitRoute);
    console.log('indexOf', visitRoute[visitRoute.length - 1]);
    console.log('indexOf', visitRoute[visitRoute.length - 1] + start);
    if (visitRoute.indexOf(visitRoute[visitRoute.length - 1] + start) >= 0) {
        console.log('visitRoute if present index', visitRoute);
        console.log(' already visited route we dont allow since it ll go in infiinte cycle');
        return '';
    }


    visitRoute += start;
    console.log('visitRoute2', visitRoute);

    return Object.keys(edges).map((node) => {
        console.log('NODE',node,edges);
        // No 0 cost routes should be included as per requirements
        if (edges[node] === 0) {
            return '';
        }       
        const route = getPossiblePaths(node, end, graph, visitRoute, count + edges[node]);
        console.log('****************************************',);
        return route;
    }).filter((empty) => !!empty).join(';'); // Filter the routes (empty str) which had deadend
}
